const Product = ({post}) => {
  return (
  <div>
     <div>{post.title}</div>
     <div>{post.description}</div>
     <div>{post.image}</div>
     <div>{post.price}</div>
     <div>
      <button>
        selected ? <p>Re</p>
      </button>
     </div>
  </div>);
};

export default Product;
